import { products } from "../../../data";
import { Product } from "./components";

const Products = () => {
  return (
    <ul>
      {products.map(({ image, name, price, tickets, days }) => (
        <Product
          image={image}
          name={name}
          price={price}
          tickets={tickets}
          days={days}
          key={name}
        />
      ))}
    </ul>
  );
};

export { Products };
